In a terminal window, navigate to the directory where the files were extracted from the archive. Use plcncli to install the SDK. You are free to specify any destination directory you want, using the -d option. $ plcncli install sdk -p pxc-glibc-x86_64-axcf2152-image-sdk-cortexa9t2hf-neon-axcf2152-toolchain-2021.6.sh -d /opt/pxc/sdk/AXCF2152/2021.6
(todo: response)) You may need to change the permissions on the SDK installation file to give the current user execute privilege. Check what SDKs and targets have been installed. $ plcncli get sdks
{ "sdks": [ { "path": "/opt/pxc/sdk/AXCF2152/2021.6" } ]
} $ plcncli get targets
{ "targets": [ { "name": "AXCF2152", "version": "21.6.0.46", "longVersion": "2021.6.0 (21.6.0.46)", "shortVersion": "21.6.0", "available": null } ]
} Note that the above responses are in JSON format, which makes it easier to integrate plcncli operations into an automated workflow if required. If you need to build applications for different PLCnext Control hardware and/or firmware variants, then it is possible to use plcncli to install multiple SDKs on the host. To do this, simply repeat the installation procedure for each additional SDK. There is no need to install plcncli again.

