On the host machine, create a file called main.cpp with the following contents: #include <iostream> int main() { std::cout << "Hello World!" << std::endl; return 0;
} When cross-compiling open-source C/C++ code using the GNU Build System , it is typical - and often necessary - to define an environment variable called SDKROOT. This variable contains the path where header files, shared libraries, build tools etc. for the target platform can be found. Defining this variable is not necessary for this simple example, but let's do it anyway. In this case, we define SDKROOT as the directory in the SDK that contains the sysroot directory. For example: $ export SDKROOT=/opt/pxc/sdk/AXCF2152/2021.6 The PLCnext SDK includes a bash script that sets up the build environment, so that standard build commands will result in binaries for the target platform. Execute this bash script using the source command: $ source ${SDKROOT}/environment-setup* Now we can compile and link the program using the g++ compiler that comes with the PLCnext SDK: $ $CXX main.cpp -O -o say_hello # Build with optimisations (-O) to avoid a warning. Check that the resulting executable has been built for the correct platform: $ file say_hello
say_hello: ELF 32-bit LSB pie executable, ARM, EABI5 version 1 (SYSV), dynamically linked, interpreter /lib/ld-linux-armhf.so.3, BuildID[sha1]=b4a827997b3375494f750fa890c8796ff293d463, for GNU/Linux 3.2.0, with debug_info, not stripped Copy the executable to the PLCnext Control device: $ scp say_hello admin@192.168.1.10:~ Run the program on the PLCnext Control device: $ ssh admin@192.168.1.10
# ./say_hello
Hello World! Congratulations! You have just run your first C++ program on a PLCnext Control device.
